import React from 'react';
import { storiesOf } from '@storybook/react';
import { GridArea, fromComponents } from '../src/Grid';
import FlexRow from '../src/Flex/FlexRow';
import SpacedRow from '../src/Spaced/SpacedRow';
import SpacedLayout from '../src/Spaced/SpacedLayout';

const Page = ({ style, children }) => <article style={{ height: '100vh', ...style }}>{children}</article>;
const Block = ({ style, children }) => (
  <div style={{
    height: '100%', borderStyle: 'dashed', boxSizing: 'border-box', ...style,
  }}
  >
    {children}
  </div>
);
export default storiesOf('Recipes', module)
  .add('some search page', () => {
    const PageActions = ({ style }) => (
      <GridArea
        style={style}
        widths={['auto', 'auto']}
        columnGap="8px"
      >
        <button>Profile</button>
        <button>Help</button>
      </GridArea>
    );

    const MenuHeader = ({ style }) => (
      <SpacedLayout
        style={style}
      >
        <button>Home</button>
        <PageActions />
      </SpacedLayout>
    );

    const LogoSection = ({ style }) => (
      <SpacedRow
        spacing="middle"
        style={style}
      >
        <img
          alt="logo"
          style={{ maxHeight: '200px' }}
          src={'data:image/jpeg;base64,\n'}
        />
      </SpacedRow>);
    const Search = ({ style }) => <input placeholder="search" style={{ ...style }} />;
    const Footer = ({ style }) => (
      <SpacedLayout spacing="end" style={style}>
        <a href="/">Privacy Policy</a>
      </SpacedLayout>
    );

    return (
      <GridArea
        widths={[1, 4, 1]}
        heights={['100px', 'minmax(100px, 200px)', '100px', 'auto', '50px']}
        layout={fromComponents`
          ${MenuHeader} ${MenuHeader}   ${MenuHeader}
          .             ${LogoSection}         .
          .             ${Search}       .
          .             .               .
          ${Footer}     ${Footer}       ${Footer}
       `}
        container={Page}
      >
        <MenuHeader />
        <LogoSection />
        <Search />
        <Footer />
      </GridArea>
    );
  })
  .add('some search results page', () => {
    const MenuHeader = ({ style }) => <Block style={{ height: '100px', ...style }}>MenuHeader</Block>;
    const Filters = ({ style }) => <Block style={{ height: '100%', ...style }}>Filters</Block>;
    const ResultList = ({ style }) => <Block style={{ height: '100%', ...style }}>ResultList</Block>;
    const ResultCard = ({ style }) => <Block style={{ height: '300px', ...style }}>ResultCard</Block>;
    const Footer = ({ style }) => <Block style={{ ...style }}>Footer</Block>;

    return (
      <GridArea
        widths={[1, 'minmax(300px, 500px)', 'minmax(200px, 300px)', 2]}
        heights={['100px', '50px', 1, '100px']}
        layout={fromComponents`
          ${MenuHeader} ${MenuHeader}   ${MenuHeader}  ${MenuHeader}
          .             ${Filters}      .              .
          .             ${ResultList}   ${ResultCard}  .
          ${Footer}     ${Footer}       ${Footer}      ${Footer}
       `}
        container={Page}
      >
        <MenuHeader />
        <Filters />
        <ResultList />
        <ResultCard />
        <Footer />
      </GridArea>
    );
  });
